import React, { useState } from 'react';
import { Search, Grid, List } from 'lucide-react';
import AppLayout from './app-layout'; // Assure-toi que le chemin est correct

const CataloguePage = () => {
  const [viewMode, setViewMode] = useState('grid');
  const [searchQuery, setSearchQuery] = useState('');
  const [filters, setFilters] = useState({
    type: 'all',
    energy: 'all',
    priceRange: 'all'
  });

  const vehicles = [
    {
      id: 1,
      name: "Tesla Model 3",
      type: "automobile",
      energy: "electric",
      price: 42900,
      image: "/api/placeholder/400/300",
      description: "Berline électrique performante"
    },
    {
      id: 2,
      name: "Vespa Elettrica",
      type: "scooter",
      energy: "electric",
      price: 7499,
      image: "/api/placeholder/400/300",
      description: "Scooter électrique urbain"
    },
  ];

  const FilterSidebar = () => (
    <div className="bg-gray-800 p-4 rounded-lg">
      <h3 className="text-lg font-semibold mb-4">Filtres</h3>
      <div className="space-y-4">
        <div>
          <label className="block text-sm font-medium mb-2">Type de véhicule</label>
          <select 
            className="w-full bg-gray-700 border-gray-600 rounded-md"
            value={filters.type}
            onChange={(e) => setFilters({...filters, type: e.target.value})}
          >
            <option value="all">Tous</option>
            <option value="automobile">Automobile</option>
            <option value="scooter">Scooter</option>
          </select>
        </div>

        <div>
          <label className="block text-sm font-medium mb-2">Énergie</label>
          <select 
            className="w-full bg-gray-700 border-gray-600 rounded-md"
            value={filters.energy}
            onChange={(e) => setFilters({...filters, energy: e.target.value})}
          >
            <option value="all">Toutes</option>
            <option value="electric">Électrique</option>
            <option value="gasoline">Essence</option>
          </select>
        </div>

        <div>
          <label className="block text-sm font-medium mb-2">Gamme de prix</label>
          <select 
            className="w-full bg-gray-700 border-gray-600 rounded-md"
            value={filters.priceRange}
            onChange={(e) => setFilters({...filters, priceRange: e.target.value})}
          >
            <option value="all">Tous les prix</option>
            <option value="0-10000">0 - 10 000 €</option>
            <option value="10000-30000">10 000 - 30 000 €</option>
            <option value="30000+">30 000 € et plus</option>
          </select>
        </div>
      </div>
    </div>
  );

  return (
    <AppLayout>
      <div className="flex flex-col space-y-6">
        {/* Barre de recherche et contrôles */}
        <div className="flex flex-col md:flex-row gap-4 items-center">
          <div className="relative flex-1">
            <input
              type="text"
              placeholder="Rechercher un véhicule..."
              className="w-full pl-10 pr-4 py-2 bg-gray-800 border border-gray-700 rounded-lg focus:ring-blue-500 focus:border-blue-500"
              value={searchQuery}
              onChange={(e) => setSearchQuery(e.target.value)}
            />
            <Search className="absolute left-3 top-2.5 h-5 w-5 text-gray-400" />
          </div>

          <div className="flex items-center space-x-4">
            <button
              onClick={() => setViewMode('grid')}
              className={`p-2 rounded-md ${viewMode === 'grid' ? 'bg-blue-600' : 'bg-gray-700'}`}
            >
              <Grid className="h-5 w-5" />
            </button>
            <button
              onClick={() => setViewMode('list')}
              className={`p-2 rounded-md ${viewMode === 'list' ? 'bg-blue-600' : 'bg-gray-700'}`}
            >
              <List className="h-5 w-5" />
            </button>
          </div>
        </div>

        {/* Contenu principal */}
        <div className="flex flex-col md:flex-row gap-6">
          {/* Sidebar des filtres */}
          <div className="md:w-64 flex-shrink-0">
            <FilterSidebar />
          </div>

          {/* Grille de véhicules */}
          <div className="flex-1">
            <div className={`grid gap-6 ${
              viewMode === 'grid' ? 'grid-cols-1 md:grid-cols-3' : 'grid-cols-1'
            }`}>
              {vehicles.map((vehicle) => (
                <div key={vehicle.id} className="bg-gray-800 rounded-lg overflow-hidden">
                  <img
                    src={vehicle.image}
                    alt={vehicle.name}
                    className="w-full h-48 object-cover"
                  />
                  <div className="p-4">
                    <h3 className="text-lg font-semibold mb-2">{vehicle.name}</h3>
                    <p className="text-gray-300 mb-4">{vehicle.description}</p>
                    <div className="flex justify-between items-center">
                      <span className="text-blue-400 font-bold">{vehicle.price.toLocaleString()} €</span>
                      <button className="px-4 py-2 bg-blue-600 rounded-md hover:bg-blue-700">
                        Voir détails
                      </button>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </AppLayout>
  );
};

export default CataloguePage;
